import Carousel from 'react-multi-carousel'
import "./newsboard.css"
const Newsboard = () => {
  return (
    <div className='newsboard'>
        <h2 className='main-heading-style'>Newsboard</h2>
        <div className='news-section-container'>
            <h4 className=''>Latest News</h4>
            <Carousel
  additionalTransfrom={0}
  arrows
  autoPlaySpeed={3000}
  centerMode={false}
  className=""
  containerClass="container-with-dots"
  dotListClass=""
  draggable
  focusOnSelect={false}
  infinite
  itemClass=""
  keyBoardControl
  minimumTouchDrag={80}
  pauseOnHover
  renderArrowsWhenDisabled={false}
  renderButtonGroupOutside={false}
  renderDotsOutside={false}
  responsive={{
    desktop: {
      breakpoint: {
        max: 3000,
        min: 1024
      },
      items: 3,
      partialVisibilityGutter: 40
    },
    mobile: {
      breakpoint: {
        max: 464,
        min: 0
      },
      items: 1,
      partialVisibilityGutter: 30
    },
    tablet: {
      breakpoint: {
        max: 1024,
        min: 464
      },
      items: 2,
      partialVisibilityGutter: 30
    }
  }}
  rewind={false}
  rewindWithAnimation={false}
  rtl={false}
  shouldResetAutoplay
  showDots={true}
  sliderClass=""
  slidesToSlide={1}
  swipeable
>


            <div className='newsboard_card-container'>
                <img src='/assets/newsboard/marketnews.png' className='news-image'/>
                <h6>IndiGo CEO Ronojoy Dutta to step down in September, Pieter Elbers to succeed him</h6>
                <p>Dutta, 71, will retire on September 30, 2022, after guiding IndiGo through the turbulent COVID-19 period, the private carrier announced.
</p>
